import React, { useState, Dispatch, SetStateAction, } from 'react';
import {
    DetailedIconArrayObject,
  }
from './iconArrayGeneration';

type OptionalMiddleName = {
    talentPathDetailedIconArray: DetailedIconArrayObject;
    handleClick: React.MouseEventHandler<HTMLButtonElement>;
    handleRightClick: React.MouseEventHandler<HTMLButtonElement>;
}

function SkillsList({talentPathDetailedIconArray, handleClick, handleRightClick}:OptionalMiddleName, setTalentPathDetailedIconArray){
    <div>
        <p> Talent Path 1</p>
        {talentPathDetailedIconArray.map((icon: DetailedIconArrayObject, i: number) => {
        return (<div key = {i} className={`${icon?.iconClicked? "active" : "inactive"}`} onClick={e => handleClick(e, icon, i, talentPathDetailedIconArray, setTalentPathDetailedIconArray)} onContextMenu={e => handleRightClick(e, icon, i, talentPathOneDetailedIconArray, setTalentPathOneDetailedIconArray)}  >
        <img onMouseOver={(e) => {e.currentTarget.src = icon.icon}} onMouseOut={(e) => {e.currentTarget.src = icon.iconFaded}} src={icon.iconClicked?icon.icon : icon.iconFaded} alt=""/>
        </div>)
        })
        }
    </div>
}


export default SkillsList;
